class Solution(object):    
    def wiggleSort(self, nums):
        """
        :type nums: List[int]
        :rtype: void Do not return anything, modify nums in-place instead.
        """
        if not nums:
            return []

        srt = 0
        end = limit = len(nums)
        target = end / 2
        div = limit | 1

        while True:
            left_wall = srt
            right_wall = end - 1
            temp_left_wall = temp_srt = (srt * 2 + 1) % div
            pivot = nums[temp_srt]
            idx = srt + 1

            while idx <= right_wall:
                temp_idx = (idx * 2 + 1) % div

                if nums[temp_idx] > pivot:
                    left_wall += 1
                    temp_left_wall = (left_wall * 2 + 1) % div
                    nums[temp_idx], nums[temp_left_wall] = nums[temp_left_wall], nums[temp_idx]
                elif nums[temp_idx] < pivot:
                    while right_wall >= idx and nums[(right_wall * 2 + 1) % div] < pivot:
                        right_wall -= 1

                    temp_right_wall = (right_wall * 2 + 1) % div

                    if nums[temp_right_wall] == pivot:
                        nums[temp_idx], nums[temp_right_wall] = nums[temp_right_wall], nums[temp_idx]
                    else:
                        left_wall += 1
                        temp_left_wall = (left_wall * 2 + 1) % div
                        nums[temp_left_wall], nums[temp_idx] = nums[temp_idx], nums[temp_left_wall]
                        nums[temp_left_wall], nums[temp_right_wall] = nums[temp_right_wall], nums[temp_left_wall]
                        
                    right_wall -= 1
                else:
                    pass

                idx += 1

            nums[temp_srt], nums[temp_left_wall] = nums[temp_left_wall], nums[temp_srt]

            if right_wall < target:
                srt = right_wall + 1
            elif left_wall > target:
                end = left_wall
            else:
                break

        return nums

    def wiggleSort2(self, nums):
        """
        :type nums: List[int]
        :rtype: void Do not return anything, modify nums in-place instead.
        """
        if not nums:
            return []

        srt = 0
        end = limit = len(nums)
        target = end / 2

        while True:
            left_wall = srt
            pivot = nums[srt]
            right_wall = end - 1
            idx = srt + 1

            while idx <= right_wall:
                if nums[idx] > pivot:
                    left_wall += 1
                    nums[idx], nums[left_wall] = nums[left_wall], nums[idx]
                elif nums[idx] < pivot:
                    while right_wall >= idx and nums[right_wall] < pivot:
                        right_wall -= 1

                    if nums[right_wall] == pivot:
                        nums[idx], nums[right_wall] = nums[right_wall], nums[idx]
                    else:
                        left_wall += 1
                        nums[left_wall], nums[right_wall] = nums[right_wall], nums[left_wall]
                        nums[idx], nums[right_wall] = nums[right_wall], nums[idx] 

                    right_wall -= 1
                else:
                    pass
                
                idx += 1
            
            nums[srt], nums[left_wall] = nums[left_wall], nums[srt]

            if right_wall < target:
                srt = right_wall + 1
            elif left_wall > target:
                end = left_wall
            else:
                break

        mid = nums[target]
        div = limit | 1
        left = idx = 0
        right = limit - 1

        while idx <= right:
            temp_idx = (2 * idx + 1) % div

            if nums[temp_idx] > mid:
                temp_left = (2 * left + 1) % div
                nums[temp_idx], nums[temp_left] = nums[temp_left], nums[temp_idx]
                idx += 1
                left += 1
            elif nums[temp_idx] < mid:
                temp_right = (2 * right + 1) % div
                nums[temp_idx], nums[temp_right] = nums[temp_right], nums[temp_idx]
                right -= 1
            else:
                idx += 1

        return nums

